ALTER TABLE venda
ADD COLUMN id_funcionario INTEGER NULL;

UPDATE venda SET id_funcionario = 1
WHERE id_venda BETWEEN 1 AND 5;

UPDATE venda SET id_funcionario = 2
WHERE id_venda BETWEEN 6 AND 10;

UPDATE venda SET id_funcionario = 3
WHERE id_venda BETWEEN 11 AND 15;

UPDATE venda SET id_funcionario = 4
WHERE id_venda BETWEEN 16 AND 20;

UPDATE venda SET id_funcionario = 5
WHERE id_venda BETWEEN 21 AND 25;

UPDATE venda SET id_funcionario = 6
WHERE id_venda BETWEEN 26 AND 30;

UPDATE venda SET id_funcionario = 7
WHERE id_venda BETWEEN 31 AND 35;

alter table venda
add constraint fk_venda_funcionario foreign key (id_funcionario)
references funcionario (id_funcionario);

alter table venda
alter column id_funcionario set not null; 
